import React from 'react'

export const TableRow = ({item, deleteItem}) => {
  return (
    <tr>
        <td>{item.name}</td>
        <td>{item.price}</td>
        <td><button onClick={deleteItem(item.id)}>Delete</button></td>
    </tr>
  )
}
